import React from 'react';
import Header from './Header';
import Footer from './Footer';
import MainCard from './MainCard';
import OverviewCards from './OverviewCards';
import media_data from '../media_data';


function App() {
  return (
    <div >
      <div className="page">
        <Header />
        <div className="main-dashboard">
          {media_data.map(data => <MainCard
            key={data.media_name}
            id={data.id}
            followers={data.followers}
            mediaName={data.media_name}
            upDownNum={data.upDown_num}
          />

          )}

        </div>

        <h2>Overview - Today</h2>
        <div className="overview">
        {media_data.map(data => 
        <OverviewCards key={data.media_name}
            mediaName={data.media_name}
            viewsRetweets={data.views_retweets}
            viewsRetweetsRate={data.views_retweets_rate}
            likes={data.likes}
            likesRate={data.likes_rate}
            />
          )} 
        </div>
      </div>
      <Footer />


    </div>
  );
}

export default App;
